import React from "react";
import { Button, Container } from "@material-ui/core";
import DeleteIcon from "@material-ui/icons/Delete";
import {
  Card,
  CardActionArea,
  CardMedia,
  makeStyles,
  CardContent,
  Typography,
  AppBar,
  Toolbar,
} from "@material-ui/core";
const useStyles = makeStyles((theme) => ({
  button: { ...theme.mybutton },
  nav: { ...theme.myNav },
  small:{
      display:'none',
      [theme.breakpoints.up('sm')]:{
          display:'block'
      }
  },
  large:{
    display:'block',
    [theme.breakpoints.up('sm')]:{
        display:'none'
    }
}
}));
export default function Signup() {
  const classes = useStyles();
  return (
    <>
      <AppBar>
        <Toolbar className={classes.nav}>
          <Typography variant="h6" className={classes.small}>E-COMMERCE</Typography>
          <Typography variant="h6" className={classes.large}>E-COM</Typography>
          <div>
          <Button variant="contained" color="success" className={classes.button}>Log in</Button>
          <Button variant="contained" color="success" className={classes.button}>Sign up</Button>
          </div>
        </Toolbar>
      </AppBar>
     <Container>
        <Typography variant="h1">welcome to my world</Typography>
     </Container>
     <Card>
         <CardContent>
             <label>
                 Username:
             </label>
             <input type='text'/>
             <input type='text'/>

         </CardContent>
     </Card>
    </>
  );
}
